  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0138579 includes physical
  and profile data collected aboard NOAA Ship FAIRWEATHER during project OPR-R976-FA-15
  in the Bering Sea from 2015-06-16 to 2015-09-04. These data include CONDUCTIVITY,
  HYDROSTATIC PRESSURE, SALINITY, SOUND VELOCITY, WATER DENSITY and WATER TEMPERATURE.
  The instruments used to collect these data include CTD. These data were collected
  and submitted by the NOAA Office of Coast Survey in support of hydrographic multibeam
  surveys to meet NOAA charting requirements.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
